<template>
  <!-- https://www.youtube.com/watch?v=vAJEHf92tV0&list=PLYElE_rzEw_t0--arG7_fu1uqkwOht1Jg -->
  <div>
    <button class="z-40 bg-white border" @click="clickWrapBtn">reset</button>
    <input
      type="text"
      v-model="imageUrlText"
      placeholder="이미지 주소를 입력하세요"
    />
    <button class="z-40 bg-white border" @click="cahngeImage">체인지</button>
    <br />
    <br />
    <br />
    <br />
    <canvas ref="canvasRef" class="w-[80vw] h-[80vh] mx-auto">
      <img
        class="hidden"
        ref="imagRef"
        src="data:image/png;base64,"
        alt=""
      />
    </canvas>
  </div>
</template>

<script setup lang="ts">
import { baseImage1, readerUploadImageURLByBase64 } from "~~/common/image";

const canvasRef = ref<HTMLCanvasElement>();
const imagRef = ref<HTMLImageElement>();
const imageUrlText = ref();

let ctx: CanvasRenderingContext2D;
let effect: Effect;
let aniFrameIndex: number;

const clickWrapBtn = () => {
  effect.reset();
};

const cahngeImage = async () => {
  if (!canvasRef.value) return;
  if (!imagRef.value) return;

  const url = imageUrlText.value || baseImage1;

  const imageData = await readerUploadImageURLByBase64(url);

  imagRef.value.src = imageData + "";

  setTimeout(() => {
    effect.init(ctx);
  }, 0);

  // console.log(effect);
};

class Particle {
  x = 0;
  y = 0;
  size = 0;
  vx = 0;
  vy = 0;
  originX = 0;
  originY = 0;
  ease = 0.25;
  // 마우스 감지
  friction = 0.98;
  dx = 0;
  dy = 0;
  distance = 0;
  force = 0;
  angle = 0;

  constructor(
    public effect: Effect,
    _x: number,
    _y: number,
    public color: string
  ) {
    this.x = Math.random() * this.effect.width;
    this.y = Math.random() * this.effect.hegiht;
    // this.x = _x;
    // this.y = _y;
    this.originX = Math.floor(_x);
    this.originY = Math.floor(_y);
    this.size = this.effect.gap;
  }

  draw(context: CanvasRenderingContext2D) {
    context.fillStyle = this.color;
    context.fillRect(this.x, this.y, this.size, this.size);
  }
  update() {
    // 마우스 감지
    this.dx = this.effect.mouse.x! - this.x;
    this.dy = this.effect.mouse.y! - this.y;

    this.distance = this.dx * this.dx + this.dy * this.dy;
    this.force = -this.effect.mouse.radius / this.distance;

    if (this.distance < this.effect.mouse.radius) {
      this.angle = Math.atan2(this.dy, this.dx);
      this.vx += this.force * Math.cos(this.angle);
      this.vy += this.force * Math.sin(this.angle);
    }

    // 위치 업데이트
    this.x += this.vx * this.friction + (this.originX - this.x) * this.ease;
    this.y += this.vy * this.friction + (this.originY - this.y) * this.ease;
  }
  reset() {
    this.x = Math.random() * this.effect.width;
    this.y = Math.random() * this.effect.hegiht;
    this.vx = 0;
    this.vy = 0;
    // this.ease = 0.2;
  }
}

class Effect {
  particlesArray: Particle[] = [];
  width = 0;
  hegiht = 0;
  centerX = 0;
  centerY = 0;
  x = 0;
  y = 0;
  gap = 2;
  mouse = {
    radius: 300,
    x: undefined as number | undefined,
    y: undefined as number | undefined,
  };

  constructor(
    public canvas: HTMLCanvasElement,
    public image: HTMLImageElement
  ) {
    this.width = canvas.width;
    this.hegiht = canvas.height;
    this.centerX = this.width * 0.5;
    this.centerY = this.hegiht * 0.5;
    this.x = this.centerX - this.image.width * 0.5;
    this.y = this.centerY - this.image.height * 0.7;

    // 마우스 감지
    window.addEventListener("mousemove", (event: any) => {
      this.mouse.x = +event.x - canvas.offsetLeft;
      this.mouse.y = +event.y - canvas.offsetTop;
    });
  }

  init(context: CanvasRenderingContext2D) {
    this.particlesArray.length = 0;
    ctx.clearRect(0, 0, this.width, this.hegiht);

    context.drawImage(this.image, this.x, this.y);
    // 캔버스 이미지 정보 데이터화
    const pixels = context.getImageData(0, 0, this.width, this.hegiht).data;

    for (let y = 0; y < this.hegiht; y += this.gap) {
      for (let x = 0; x < this.width; x += this.gap) {
        // 데이터 정보 파티클 로 변환
        const index = (y * this.width + x) * 4;
        const red = pixels[index];
        const green = pixels[index + 1];
        const blue = pixels[index + 2];
        const alpha = pixels[index + 3];
        const color = `rgb(${red},${green},${blue})`;

        if (alpha > 0) {
          this.particlesArray.push(new Particle(this, x, y, color));
        }
      }
    }
  }

  draw(context: CanvasRenderingContext2D) {
    this.particlesArray.forEach((particle) => particle.draw(context));
  }
  update() {
    this.particlesArray.forEach((particle) => particle.update());
  }
  reset() {
    this.particlesArray.forEach((particle) => particle.reset());
  }
}

onMounted(() => {
  if (!canvasRef.value) return;
  if (!imagRef.value) return;

  // 캔버스 넓이 지정 안하면 흐려짐
  canvasRef.value.width = canvasRef.value.clientWidth;
  canvasRef.value.height = canvasRef.value.clientHeight;

  ctx = canvasRef.value.getContext("2d", {
    willReadFrequently: true,
  })!;

  effect = new Effect(canvasRef.value, imagRef.value);

  effect.init(ctx);

  animate();
});

onUnmounted(() => {
  cancelAnimationFrame(aniFrameIndex);
});

function animate() {
  if (!canvasRef.value) return;

  ctx.clearRect(0, 0, canvasRef.value?.width, canvasRef.value?.height);
  effect.draw(ctx);
  effect.update();
  aniFrameIndex = requestAnimationFrame(animate);
}
</script>

